// tslint:disable:max-line-length

export const initOptions = {
  // NOTE: Audio

  // - Disable measuring of audio levels.
  disableAudioLevels: false,

  // - Start the conference in audio only mode (no video is being received nor sent).
  // startAudioOnly: false,

  // - Every participant after the Nth will start audio muted.
  // startAudioMuted: 10,

  // - Start calls with audio muted. Unlike the option above, this one is only applied locally.
  // startWithAudioMuted: false,

  // Enabling it (with #params) will disable local audio output of remote participants and to enable it back a reload is needed.
  // startSilent: false

  // NOTE: Video

  // - Sets the preferred resolution (height) for local video. Defaults to 720.
  // resolution: 720,

  // - The constraints are independency from
  // this config's resolution value. Defaults to requesting an ideal aspect
  // ratio of 16:9 with an ideal resolution of 720.
  // constraints: {
  //     video: {
  //         aspectRatio: 16 / 9,
  //         height: {
  //             ideal: 720,
  //             max: 720,
  //             min: 240
  //         }
  //     }
  // },

  // - Enable / disable simulcast support.
  disableSimulcast: false,

  // - Enable / disable layer suspension.  If enabled, endpoints whose HD
  // layers are not in use will be suspended (no longer sent) until they
  // are requested again.
  // enableLayerSuspension: false,

  // - Suspend sending video if bandwidth estimation is too low. This may cause problems with audio playback. Disabled until these are fixed.
  // disableSuspendVideo: true,

  // - Every participant after the Nth will start video muted.
  // startVideoMuted: 10,

  // - Start calls with video muted. Unlike the option above, this one is only applied locally.
  // startWithVideoMuted: false,

  // - If set to true, prefer to use the H.264 video codec (if supported).
  // Note that it's not recommended to do this because simulcast is not
  // supported when  using H.264. For 1-to-1 calls this setting is enabled by
  // default and can be toggled in the p2p section.
  // preferH264: true,

  // - If set to true, disable H.264 video codec by stripping it out of the SDP.
  // disableH264: false,

  // NOTE: Desktop sharing

  // - The ID of the jidesha extension for Chrome.
  desktopSharingChromeExtId: null,

  // - Whether desktop sharing should be disabled on Chrome.
  // desktopSharingChromeDisabled: false,

  // - Enable / disable desktop sharing
  disableDesktopSharing: false,

  // - The media sources to use when using screen sharing with the Chrome extension.
  desktopSharingChromeSources: ['screen', 'window', 'tab'],

  // - Required version of Chrome extension
  desktopSharingChromeMinExtVersion: '0.1',

  // - The ID of the jidesha extension for Firefox. If null, we assume that no extension is required.
  // desktopSharingFirefoxExtId: null,

  // - Whether desktop sharing should be disabled on Firefox.
  // desktopSharingFirefoxDisabled: false,

  // - Whether desktop sharing should be disabled on Firefox.
  // desktopSharingFirefoxExtensionURL: null,

  // - Try to start calls with screen-sharing instead of camera video.
  // startScreenSharing: false,

  // NOTE: Recording

  // - Whether to enable recording or not.
  enableRecording: true,

  // - Type for recording: one of jibri or jirecon.
  recordingType: 'jibri',

  // NOTE: Peer-To-Peer mode: used (if enabled) when there are just 2 participants.

  p2p: {
    // Enables peer to peer mode. When enabled the system will try to
    // establish a direct connection when there are exactly 2 participants
    // in the room. If that succeeds the conference will stop sending data
    // through the JVB and use the peer to peer connection instead. When a
    // 3rd participant joins the conference will be moved back to the JVB connection.
    enabled: true,

    // Use XEP-0215 to fetch STUN and TURN servers.
    // useStunTurn: true,

    // The STUN servers that will be used in the peer to peer connections
    stunServers: [
      { urls: 'stun:stun.l.google.com:19302' },
      { urls: 'stun:stun1.l.google.com:19302' },
      { urls: 'stun:stun2.l.google.com:19302' }
    ],

    // Sets the ICE transport policy for the p2p connection. At the time
    // of this writing the list of possible values are 'all' and 'relay',
    // but that is subject to change in the future. The enum is defined in
    // the WebRTC standard:
    // https://www.w3.org/TR/webrtc/#rtcicetransportpolicy-enum.
    // If not set, the effective value is 'all'.
    // iceTransportPolicy: 'all',

    // If set to true, it will prefer to use H.264 for P2P calls (if H.264
    // is supported).
    preferH264: true

    // If set to true, disable H.264 video codec by stripping it out of the SDP.
    // disableH264: false,

    // How long we're going to wait, before going back to P2P after the 3rd
    // participant has left the conference (to filter out page reload).
    // backToP2PDelay: 5
  },

  // NOTE: Misc

  // Default value for the channel "last N" attribute. -1 for unlimited.
  channelLastN: -1,

  // - Disables or enables RTX (RFC 4588) (defaults to false).
  // disableRtx: false,

  // - Use XEP-0215 to fetch STUN and TURN servers.
  // useStunTurn: true,

  // - Enable IPv6 support.
  useIPv6: true,

  // disableAEC: false,

  // disableAP: false,

  // - Enables / disables a data communication channel with the Videobridge.
  // Values can be 'datachannel', 'websocket', true (treat it as
  // 'datachannel'), undefined (treat it as 'datachannel') and false (don't open any channel).
  // openBridgeChannel: true,

  // NOTE: Stats

  // - Whether to enable stats collection or not in the TraceablePeerConnection.
  // This can be useful for debugging purposes (post-processing/analysis of
  // the webrtc stats) as it is done in the jitsi-meet-torture bandwidth estimation tests.
  // gatherStats: false,

  // - To enable sending statistics to callstats.io you must provide the Application ID and Secret.
  // callStatsID: '',
  // callStatsSecret: '',

  // - Enables sending participants display name to callstats
  // enableDisplayNameInStats: false

  // - Enables sending participants email if available to callstats and other analytics
  // enableEmailInStats: false

  // NOTE: Privacy

  // - If third party requests are disabled, no other server will be contacted.
  // This means avatars will be locally generated and callstats integration will not function.
  disableThirdPartyRequests: false,

  // enableWindowOnErrorHandler: false,

  // - If true callstats will be disabled and the callstats API won't be included.
  enableAnalyticsLogging: process.env.NODE_ENV === 'development'

  // callStatsConfIDNamespace: '',

  // callStatsCustomScriptUrl: ''
}

// List of undocumented settings used in lib-jitsi-meet
/*
  _peerConnStatusOutOfLastNTimeout
  _peerConnStatusRtcMuteTimeout
  abTesting
  avgRtpStatsN
  desktopSharingSources
  disableAGC
  disableHPF
  disableNS
  enableLipSync
  enableTalkWhileMuted
  forceJVB121Ratio
  hiddenDomain
  ignoreStartMuted
  nick
  startBitrate
*/
